column8:
■NASOSとして、Windowsクライアントとの親和性が高い「WindowsStorageServer2003R2」を搭載。Windowsドメイン(ActiveDirectory)環境下のユーザー情報を利用することが可能です。導入時など、アクセス権の設定を短時間で行うことができます。
■WindowsStorageServer2003を搭載したサーバを構築する場合と異なり、クライアントライセンスが不要。別途でのライセンス費用が発生しないため、低コスト!
<br>■WindowsVista、XPProfessional搭載クライアントのリモートデスクトップからの操作で、管理が可能。遠隔地からの、リモート管理が可能。
<br>■ギガビットイーサネット対応、高性能CPU:1.0GHz搭載、大容量メモリ:1GB搭載により、高速データ転送、高速処理を実現。複数クライアントからの同時時アクセス時に、威力を発揮します。
<br>■障害やイベントの発生をE-mailで通知する機能を搭載。万一の障害発生時にも素早く対応ができます。
<br>■UPSを接続するためのシリアルポート(RS-232C準拠)とUSBポートを搭載。万一の停電時に、NASのシャットダウン処理を自動で実行可能です。
<br>■お取り寄せのため、3日～5日掛かります。
<br>■初期不良の交換は一週間以内です。
<br>■それ以降は、メーカーに直接対応して頂く形になります。
<br>■保証はメーカーの物に準じます。<style type="text/css">
